import styled from "styled-components";
import "./App.css";
import { Button, Container } from "react-bootstrap";
import { BrowserRouter, Link } from "react-router-dom";
import Ticket from "./Tickets";

const Title = styled.div`
  padding-top: 20px;
  padding-bottom: 20px;
  text-align: center;
  font-size: 60px;
  color: white;
  font-family: "Licorice", cursive;
`;

const Completed = styled.div`
  display: grid;
  text-align: center;
  text-decoration: none;
  color: white;
  padding-bottom: 30px;
`;

function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <Title>Feladatok</Title>

        <Completed>
          <nav>
            <Link to="/uncompleted">
              <Button className="Uncompleted" variant="dark">
                Elvégzendő feladatok
              </Button>
            </Link>
          </nav>

          <Link to="/completed">
            <Button className="Completed" variant="dark">
              Teljesített feladatok
            </Button>
          </Link>

          <Link to="all">
            <Button className="All" variant="dark">
              Összes feladat
            </Button>
          </Link>

          <Link to="new">
            <Button className="Add" variant="dark">
              Feladat hozzáadása
            </Button>
          </Link>
        </Completed>
        <Ticket />
      </div>
    </BrowserRouter>
  );
}

export default App;
